function SteuerungEntkalkung(Steuerung_Entkalkungsanlage) {
  if (Steuerung_Entkalkungsanlage == 'ausschalten' && getState("javascript.0.Gartenbewaesserung.Entkalkung_ausschalten").val == true && getState("hm-rpc.2.0001D709A56F9D.3.STATE").val == true) {
    console.log('Entkalkungsanlage wird abgeschaltet');
    setState("hm-rpc.2.0001D709A56F9D.3.STATE"/*HWR_Entkalkungsanlage:3.STATE*/, false);
  } else if (Steuerung_Entkalkungsanlage == 'einschalten' && getState("javascript.0.Gartenbewaesserung.Entkalkung_ausschalten").val == true && getState("hm-rpc.2.0001D709A56F9D.3.STATE").val == false) {
    console.log('Entkalkungsanlage wird wieder eingeschaltet');
    setState("hm-rpc.2.0001D709A56F9D.3.STATE"/*HWR_Entkalkungsanlage:3.STATE*/, true);
  } else {
    console.log('Entkalkungsanlage bleibt aktiviert');
  }
}

