function SteuerungVentile(Ventil, Steuerung_Ventil) {
  if (Ventil == 'Innen') {
    ObjektID_Ventil = 'hm-rpc.1.OEQ0044740.1.STATE';
  } else if (Ventil == 'Aussen') {
    ObjektID_Ventil = 'hm-rpc.1.OEQ0044740.2.STATE';
  } else if (Ventil == 'Straeucher') {
    ObjektID_Ventil = 'hm-rpc.1.OEQ0044740.3.STATE';
  }
  setStateDelayed(ObjektID_Ventil, Steuerung_Ventil, false, parseInt(0, 10), false);
  setState("javascript.0.Gartenbewaesserung.Bewaesserung_ist_aktiviert"/*Gartenbewaesserung.Bewaesserung_ist_aktiviert*/, Steuerung_Ventil, true);
  // Log
  console.log((['Gartenbewässerung ',Ventil,'auf ',Steuerung_Ventil,' geschaltet (Automatik)'].join('')));
  // Telegram
  if (getState("javascript.0.Gartenbewaesserung.Automatik_Telegram_Benachrichtigung").val == true) {
    sendTo("telegram", "send", {
        text: (['Gartenbewässerung ',Ventil,' auf ',Steuerung_Ventil,' geschaltet (Automatik)'].join(''))
    });
  }
}


