schedule("*/50 * * * * *", function () {
  // Läuft die Bewässerung aktuell?
  // Wenn nicht mache weiter, sonst abbruch
  if (getState("javascript.0.Gartenbewaesserung.Bewaesserung_ist_aktiviert").val == false) {
    console.log('Bewässerung_ist_aktiviert = false');
    if (getState("javascript.0.Gartenbewaesserung.Automatik").val == true) {
      console.log('Bewässerung_ist_aktiviert = false & Automatik = true - Warte auf cronjob Zeit');
      // Cron Job mit Werten aus VIS
      automatik = schedule(getState("javascript.0.Gartenbewaesserung.Zeitsteuerung_Automatik.Startzeit_Minute").val.trim() + ' ' + getState("javascript.0.Gartenbewaesserung.Zeitsteuerung_Automatik.Startzeit_Stunde").val.trim() + ' ' + '*'.trim() + ' ' + '*'.trim() + ' ' + getState("javascript.0.Gartenbewaesserung.Zeitsteuerung_Automatik.Wochentag").val.trim(), function () {
        console.log('Cronjob ausgeführt');
        berechne_laufzeiten();
        SteuerungEntkalkung('ausschalten');
        // ++++ INNEN ++++
        if (getState("javascript.0.Gartenbewaesserung.Automatik_inkl_Innen").val == true) {
          // Ventil Innen einschalten
          SteuerungVentile('Innen', true);
          // Telegram
          timeout_ende_innen = setTimeout(function () {
            // Ventil Innen ausschalten
            SteuerungVentile('Innen', false);
          }, laufzeit_rasen_innen);
        }
        // ++++ AUßEN++++
        if (getState("javascript.0.Gartenbewaesserung.Automatik_inkl_Außen").val == true) {
          timeout_start_aussen = setTimeout(function () {
            // Ventil Außen einschalten
            SteuerungVentile('Aussen', true);
            timeout_ende_aussen = setTimeout(function () {
              // Ventil Außen ausschalten
              SteuerungVentile('Aussen', false);
            }, laufzeit_rasen_aussen);
          }, laufzeit_rasen_innen);
        }
        // ++++ STRÄUCHER ++++
        if (getState("javascript.0.Gartenbewaesserung.Automatik_inkl_Straeucher").val == true) {
          // Warte Zeit für Innen und Aussen Bewässerung
          timeout_start_aussen_2 = setTimeout(function () {
            timeout_start_aussen_3 = setTimeout(function () {
              // Ventil Sträucher einschalten
              SteuerungVentile('Straeucher', true);
              timeout_ende_straeucher = setTimeout(function () {
                // Ventil Sträucher ausschalten
                SteuerungVentile('Straeucher', false);
              }, laufzeit_straeucher);
            }, laufzeit_rasen_aussen);
          }, laufzeit_rasen_innen);
        }
        timeout = setTimeout(function () {
          timeout2 = setTimeout(function () {
            timeout3 = setTimeout(function () {
              // Entkalkung einschalten
              SteuerungEntkalkung('einschalten');
            }, laufzeit_straeucher);
          }, laufzeit_rasen_aussen);
        }, laufzeit_rasen_innen);
      });
    }
  } else if (getState("javascript.0.Gartenbewaesserung.Bewaesserung_ist_aktiviert").val == true) {
    console.log('Bewässerung_ist_aktiviert = true - nichts zu tun');
  } else {
    console.log('Bewässerung_ist_aktiviert --- SONST');
  }
});


